import React, { Component } from "react";
import "./App.css";
import Contacts from "./Contacts";

class App extends Component {
  render() {
    return (
      <div className="App">
        <h2>IronContacts</h2>
        <button onClick={this.randomizeCelebrity}>Add Random Celebrity</button>
        <Contacts />
        <Contacts
        name={this.state}
         />
      </div>
    );
  }
}

export default App;
